import { useState } from "react"
import "./styles/registration.css"

const Registration = ({onRegister}) => {
    const [userName, setUserName] = useState('')

    const onSubmit = (e) =>{
        e.preventDefault()

        if(!userName){
            alert("Please input your userName")
            return
        }
        onRegister(userName)
    }    

    return (
        <main id="main-holder">
            <h1 id="login-header">Login</h1>

            {/* <label>Welcome to the sequential modeling suevey! Please input your name and click on "Enter Survey" to begin or continue.</label> */}


            <form className="login-form" onSubmit={onSubmit}>
                <div className='form-control'>
                    <input type="text" class="login-form-field" placeholder='UserName' value={userName} onChange={(e) => setUserName(e.target.value)}/>
                </div>
                <input type="submit" value='Enter Survey' className='btn btn-block'/>
            </form>
        </main>
    )
}

export default Registration
